function VertiBar() {
    return(
        <div id="verticle_bar">
            <a href="/">Home</a>
            <a href="/letter">Cover Letter</a>
            <a href="/resume">Resume</a>
            <a href="/contact">Contact</a>
            <a href="/showcase">Project Showcase</a>
        </div>
    );
}

export default VertiBar;
